from typing import Anyfrom typing import Dictfrom pydantic import BaseModelfrom src.base.http import HttpInterfaceclass LogHttpService(HttpInterface):    """    Default HTTP service enabled in fast chat, providing convenience for developers to query logs.    """    def define_request_format(self) -> type(Any):        """        Defines the type of the log query interface.        Returns:            type(Any): The RequestFormat class which defines the structure of the request.        """        class RequestFormat(BaseModel):            # Tuple representing the time zone for the log query.            time_zone: tuple            # List of strings representing the contents to be queried in the logs.            query_contents: list        return RequestFormat    def gen_request(self, request_id: str, req: Dict) -> Dict:        """        Generates the input parameters for the log request.        Args:            request_id: the id of the http request, which helps to locate the log details.            req (Dict): The data from the request interface.        Returns:            Dict: The input parameters for the log query feature.        """        return {            "time_zone": req.get("time_zone"),            "query_contents": req.get("query_contents"),            # A constant code indicating the request is for the log feature.            "fast_chat_code": "log"        }    def process_inference_results(self, request_id: str, req: dict, inference_results: Any) -> Any:        """        Returns the query results to the caller of the /log interface.        Args:            request_id: the id of the http request, which helps to locate the log details.            req: The request data.            inference_results (Any): The results of the log query.        Returns:            Any: The results of the log query.        """        return inference_results    def get_request_id(self, req: dict):        return req["request_id"]